import React from 'react';
import { Menu } from 'semantic-ui-react'; import
{Link} from '../routes';

export default()=>{
  return (
     <Menu style={{ marginTop:'10px'}}>
     <Link route="/">
        <a className="item">
          We Care
        </a>
     </Link>

      <Menu.Menu position="right">
       <Menu.Item> Trust Funds</Menu.Item>
       <Menu.Item> + </Menu.Item>

    </Menu.Menu> </Menu> )
}
